def execute_robot_commands(field_size, commands):
    (col, row) = field_size
    robot = [1, 1]
    direction = ''
    for command in commands:
        if command == 'STOP':
            break
        elif command == 'LEFT':
            if direction == 'up':
                direction = 'left'
            elif direction == 'left':
                direction = 'down'
            elif direction == 'down':
                direction = 'right'
            else:
                direction = 'up'
        elif command == 'RIGHT':
            if direction == 'up':
                direction = 'right'
            elif direction == 'left':
                direction = 'up'
            elif direction == 'down':
                direction = 'left'
            else:
                direction = 'down'
        else:
            (di, step) = command.split()
            step = int(step)
            if direction == 'up':
                if di == 'FORWARD':
                    robot[1] = min(robot[1] + step, row)
                else:
                    robot[1] = max(robot[1] - step, 1)
            elif direction == 'left':
                if di == 'FORWARD':
                    robot[0] = max(robot[0] - step, 1)
                else:
                    robot[0] = min(robot[0] + step, col)
            elif direction == 'down':
                if di == 'FORWARD':
                    robot[1] = max(robot[1] - step, 1)
                else:
                    robot[1] = min(robot[1] + step, row)
            elif di == 'FORWARD':
                robot[0] = min(robot[0] + step, col)
            else:
                robot[0] = max(robot[0] - step, 1)
    return tuple(robot)

